import React from 'react';
import styled from 'styled-components';
//import ModiLogo from '../static/modi-home-banner.png';

import Card from './comps/card';
import Modi from './comps/modi';

const HeaderWrapper = styled('div')`
  margin: 30px;
  font-size: 28px;
  font-weight: bold;
  color: brown;
`
const Row2Wrapper = styled('div')`
    display:  flex;
    flex-direction: row;
    border : 1px solid white;
    margin:5px;
    padding: 7px;

`
const Col2Wrapper = styled('div')`
    display:  flex;
    flex-direction: column;
    border : 1px solid white;
    margin:5px;
    padding: 7px;


`



const data = [
  {
    centerName: 'HSC GOVINDPUR',
    centeAddress: 'HSC GOBINDPUR NEAR BOKARO THERMAL HOSPITAL,BOKARO THERMAL,JHARKHAND,829107',
    ageGroup: '18 & ABOVE',
    vaccineName: 'Covishield',
    vaccinePrice: 'FREE',
    dose1Qty: 123,
  },
  {
    centerName: 'Bermo Highway',
    centeAddress: 'HSC GOBINDPUR NEAR BOKARO THERMAL HOSPITAL,BOKARO THERMAL,JHARKHAND,829107',
    ageGroup: '18 & ABOVE',
    vaccineName: 'Covishield',
    vaccinePrice: 'FREE',
    dose1Qty: 0,
  },
  {
    centerName: 'Bokaro Thermal Township',
    centeAddress: 'HSC GOBINDPUR NEAR BOKARO THERMAL HOSPITAL,BOKARO THERMAL,JHARKHAND,829107',
    ageGroup: '18 & ABOVE',
    vaccineName: 'Covishield',
    vaccinePrice: 'FREE',
    dose1Qty: 0,
  },
  {
    centerName: 'Phusro Railway Station',
    centeAddress: 'HSC GOBINDPUR NEAR BOKARO THERMAL HOSPITAL,BOKARO THERMAL,JHARKHAND,829107',
    ageGroup: '18 & ABOVE',
    vaccineName: 'Covishield',
    vaccinePrice: 'FREE',
    dose1Qty: 4,
  },
]

export default function App() {
  return (
    <>
      <Row2Wrapper>
          <Col2Wrapper>
            <HeaderWrapper>COWIN SLOTS</HeaderWrapper>
            {data.map(obj => 
              <Card 
                centerName={obj.centerName}
                centeAddress={obj.centeAddress}
                ageGroup={obj.ageGroup}
                vaccineName={obj.vaccineName}
                vaccinePrice={obj.vaccinePrice}
                dose1Qty={obj.dose1Qty}
              />
            )}
          </Col2Wrapper>
          <Col2Wrapper>
            <Modi/>
          </Col2Wrapper>
      </Row2Wrapper>
    </>
  );
}
